(24, 89, 23, 40, 41, 2, '2019-02-09-08-26-38/2019-02-09-08-56-03', 'com_content', 'عرس ايلة ومعتز', '2019-02-09-08-56-03', '', '<p dir=\"rtl\">إلتقت ايلة عيسى بمعتز عياصرة من خلال اصدقاء مشتركين بين الثنائي في عام 2015 في عمّان، الأردن.</p>\r\n<p dir=\"rtl\">وكللّ الثنائي معتز وايلة حبهما بالزواج في عام 2016 في فندق الشيراتون، عمّان.</p>\r\n<p dir=\"rtl\">شاركتنا ايلة بتجربتها في التخطيط لحفل زفافها من خلال الحوار التالي، وقدمت من خلاله مجموعة من النصائح للعروس العربية:</p>\r\n<ul dir=\"rtl\">\r\n<li><strong>أين أقيم حفل زفافكما ومتى؟</strong></li>\r\n</ul>\r\n<p dir=\"rtl\">وقع اختيارنا على فندق الشيراتون عمّان، وكان حفل الزفاف في 11 آب/أغسطس 2016.</p>', 1, 0, '0000-00-00 00:00:00', 1, '{\"category_layout\":\"\",\"image\":\"images\\/weddings\\/ayala_and_issas\\/ayla_and_issas_wedding.jpg\",\"image_alt\":\"2018-02-28\"}', '', '', '{\"author\":\"\",\"robots\":\"\"}', 421, '2019-02-09 08:56:03', 421, '2019-02-09 09:30:06', 0, 'ar-AA', 1),
