\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 19, 2, '', '', 1, 21, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, 'fr-FR', ''),
(7, 64, 'VERITATIS ET QSRCH BEATAE VITAE (2)', 'news-2', '<p>Vous trouverez ici quelques astuces basiques pour travailler sur votre site.</p>\r\n<ul>\r\n<li>Joomla! a une partie «Site» (ou frontale), que vous êtes en train de regarder, et une partie «Administration» (ou arrière) qui est l\'endroit où vous effectuez le travail plus avancé comme régler les menus ou décider quels modules afficher. Vous devez vous connecter à l\'administration séparément en utilisant le même identifiant et le même mot de passe que vous utilisez sur cette partie du site.</li>\r\n<li>', '</li>\r\n<li>Une des premières choses que vous souhaiterez faire sera probablement de changer le titre du site ansi que sa description. Pour cela, connectez-vous à l\'administration puis, dans le menu «Extensions», cliquez sur «Gestion des templates». Ce site est installé avec le template «Protostar» (actuellement utilisé) et le template «Beez3». Pour appliquer un template, cliquez sur l\'étoile à droite de son titre, la couleur jaune indique que le template est celui utilisé. En cliquant sur le nom du template, un formulaire est affiché vous permettant de modifier les paramètres selon vos souhaits. Vous pouvez expérimenter les différents paramètres proposés.</li>\r\n<li>Vous souhaitez probablement installer un nouveau template pour changer l\'aspect du site. Pour cela, dans le menu «Extension», cliquez sur «Gestion des extensions», vous accédez à l\'onglet «Installation».<br />Il existe de nombreux templates gratuits et commerciaux pour Joomla!</li>\r\n<li>Comme vous l\'avez déjà vu, vous pouvez contrôler qui peut voir les différentes parties de votre site. Quand vous travaillez aves des modules, articles ou liens web, régler le niveau d\'accès sur «Enregistré» signifie que seuls les utilisateurs identifiés sur le site pourront y accéder.</li>\r\n<li>Quand vous créez un nouvel article ou un autre type de contenu, vous pouvez également l\'enregistrer comme «Publié» ou «Non-publié». S\'il est «Non-publié», les visiteurs du site ne pourront pas le voir, mais vous oui.</li>\r\n<li>Vous pouvez en apprendre d\'avantage sur comment travailler avec Joomla! en consultant le <a href=\"http://docs.joomla.org\">site de documentation Joomla</a> et obtenir de l\'aide des autres utilisateurs en consultant les <a href=\"http://forum.joomla.org\">forums Joomla.org</a> (en anglais) et les <a href=\"http://forum.joomla.fr\">forums Joomla.fr</a> (en français).<br />Dans l\'administration, un bouton «Aide» est disponible dans toutes les interfaces, vous apportant des informations détaillées sur leur utilisation.</li>\r\n</ul>', 1, 10, '2018-06-23 19:58:35', 421, 'Joomla', '2018-09-23 17:12:52', 421, 0, '0000-00-00 00:00:00', '2018-06-23 19:58:35', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/news\\/latest-news-2.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 4, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
(8, 66, 'منظم الحفلات أفراح', '2019-02-03-18-34-23', '<p dir=\"rtl\">وتودون تنظيمه بشكل احترافي، منظم المناسبات أفراح سوس يضع بين أيديكم أرقى التجهيزات والمعدات اللازمة، إضافة لتوفير جميع الاحتياجات التقنية لإتمام مناسبتكم المهنية على أكمل وجه، حيث يسهل عليكم  اختيار الديكورات المناسبة للقاعة، إضافة  للمصور الجيد سواء كان فوتوغرافيا أوفيديو.</p>\r\n', '\r\n<p dir=\"rtl\">السيد جمال وطاقمه يساعدكم في التخطيط والتنفيذ على أكمل وجه، كما يقترح عليكم جملة من ألأفكار الرائعة والمتنوعة، وبخبرته يسهل تنفيذها بأقل التكاليف الممكنة لأنه قد يعتمد على خامات مختلفة ومتنوعة، إضافة إلى ذلك فأن منظم الحفلات أفراح سوس قد حضر مناسبات عديدة ويعرف أدق التفاصيل وأخطاء عدم التنظيم، ومراكز ضعف أي حفلة وبالتالي يستطيع أن يتجنب المشاكل الشائعة كما يملك الخبرة الكافية لمعالجة أي مشكلة طارئة قد تحدث أثناء هذا الحدث الجميل.</p>\r\n<p dir=\"rtl\">نقدم لزبنائنا ارقي الخدمات وبأسعار جد مناسبة، كما يمكنكم الاعتماد علينا نظرا لخبرتنا الطويلة في مجال تنظيم الحفلات، ونعدكم أن نجعل من مناسبتكم حدثا ناجحا بكل المقاييس.</p>', 1, 18, '2018-09-23 17:39:46', 421, '', '2019-02-03 19:47:43', 421, 421, '2019-02-03 20:52:52', '2018-09-23 17:39:46', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articles\\/7_461.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"images\\/articles\\/7_461.jpg\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 6, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, 'ar-AA', ''),
(9, 73, 'إكتشفي أجمل انواع شهر العسل', '2019-02-03-20-51-36', '<p>الجزر وجهات مثالية للعرسان الذين ينشدون الهدوء و الرومانسية بعيدا عن ضوضاء المدن</p>\r\n', '\r\n<p>شهر العسل هو رحلة العمر التي يستهل بها كل عروسين حياتهما المشتركة باعتبارها اولى الرحلات، وحتى يتمكن العرسان من تمضية هذه الرحلة بشكل رائع و عيش تجربة جميلة تنطبع في الذاكرة مدى العمر، فإنه لابد من الاختيار الصائب و التخطيط الحكم. و حتى يتم ذلك بشكل جيد و ناجح، على العرسان تحديد انواع رحلات شهر العسل المختلفة و اختيار النوع الذي يتناسب مع تطلعاتهما و ميولهما.</p>\r\n<p>من المؤكد ان الجزر تعتبر ملاذا مثاليا لشهر العسل، لانها عموما تكون اماكن ساحرة مفعمة بكل ما ينشده العرسان من اجواء رومانسية شاعرية. و طبيعة الجزر تسمح للعرسان بقضاء رحلة العمر بعيدًا عن ضوضاء المدن المكتظة و الاستمتاع فيها بالاستجمام على شواطئها الاسرة و الاقامة في فنادقها و منتجعاتها المتميزة و ممارسة العديد من البرامج السياحية المثالية لشهر العسل كالغوص والسباحة و التجديف و غيرها من الرياضات المائية المثيرة. الجزر بطبيعتها وبفضل اجواءها وطابعها الخاص تعد وجهات مفضلة كثيرا لتمضية رحلة العمر، فسواء وقع الاختيار على جزر المالديف او جزيرة بورا بورا او احدى الجزر الكاريبية الساحرة او غيرها من الجزر العديدة،  لاشك ان العرسان سيجدون انفسهم وسط جنة فوق الارض و سيستمتعون فيها باجمل لحظات العمر وسط اجواء الهدوء و السكينة و جمال الطبيعة.</p>\r\n<p>بالنسبة للعرسان الذين يرغبون في اكتشاف الثقافات و الحضارات المختلفة فإن المدن الكبيرة ستقدم لهم تجربة شهر عسل غنية. العديد من المدن العالمية تستهوي العرسان للتجول فيها و استكشاف تاريخها من خلال ما تضمه من معالم تاريخية وعيش اسلوب الحياة بها خلال رحلة العمر مع شريك الحياة. فمثلا يمكن للتجول في شوارع روما ايطاليا ان يترك لدى العروسين اروع الذكريات، و كذلك باريس التي تعبق معالمها المعمارية والسياحية بالثقافة الفرنسية الفريدة، و تنقل زوراها الى عالم خاص يعيشون من خلاله اسلوب الحياة الخاص بالمدينة. والعديد من المدن العالمية الاخرى مثل هونغ كونغ و نيويورك و لندن و غيرها ستكون لامحالة وجهات سياحية رائعة لتمضية شهر عسل مليء بالاثارة و كل ما هو جديد.</p>', 1, 19, '2019-02-03 20:51:36', 421, '', '2019-02-03 21:05:03', 421, 0, '0000-00-00 00:00:00', '2019-02-03 20:51:36', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/news\\/7699721-1022943913.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"images\\/news\\/7699721-1022943913_full.jpg\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 3, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, 'ar-AA', ''),
(10, 75, 'لو كان لديك علاقة سابقة ( زواج, خطبة, حب) ما هو الشيء الذي تود لو ترجع بالزمن و تغيره', '2019-02-04-20-46-05', '<p>أنا أرى بأن هذا أهم سؤال هنا لأن الصفة التي سيذكرها الرجل ستوضح لك سبب فسخه لعلاقته السابقة و ستبين لك ان كنت أنت أيضاً معرضة لأن يفسخ علاقته بك يوماً ما.. و لا تقولي ليس له علاقات سابقة, أكثر من 99% من الشباب فوق الخامسة و العشرين لهم أكثر من علاقة سابقة.. و لكن قد يتردد في الافصاح لك عن علاقاته بحكم المجتمع لذلك حاولي أن تبيني له بأنك لن تحكمي عليه و كل ما تريدينه هو فهم شخصيته أكثر<br /><br /></p>', '', 1, 22, '2019-02-04 20:46:05', 421, '', '2019-02-04 20:57:25', 421, 0, '0000-00-00 00:00:00', '2019-02-04 20:46:05', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 2, 7, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, 'ar-AA', ''),
(11, 76, 'كيف ترى المستقبل على المستويين المادي و الاجتماعي؟', '2019-02-04-20-47-30', '<p>هنا يظهر الطموح.. فلو كان انساناً طموحاً ستسمعين أحلاماً جميلة و لكن احذري, عليك الانتباه لكلامه و ملاحظة اذا كان لديه خطة ( مثلاُ سيدخر من راتبه مبلغاُ كل شهر و بعد خمس سنوات سيتوفر له مال ليبدأ مشروعه الخاص) أما ان لم يذكر لك خطة فاعرفي انه اما مغامر من النوع الذي يدخل في مشاريع دون تفكير و يخرج في أغلب الأحيان خاسراً و إما من النوع الذي يتحدث كثيراً و ينفذ قليلاً.. كما عليك الانتباه لخطته فقد لا تتحمليها, مثلاً راتبه سبعة آلاف و ينوي ادخار خمسة آلاف كل شهر و أنت تعرفين أنك لا تستطيعين العيش على ثلاثة آلاف فقط و ستقضين خمسة سنين أو أكثر في شد الأحزمة على حسب خطته.. لذلك حاولي أن تعرفي مدى ملائمة خططه لك</p>', '', 1, 22, '2019-02-04 20:47:30', 421, '', '2019-02-04 20:57:25', 421, 0, '0000-00-00 00:00:00', '2019-02-04 20:47:30', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 6, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, 'ar-AA', ''),
(12, 77, 'هل هناك شخص أساء اليك و لم تستطع مسامحته و لماذا', '2019-02-04-20-48-40', '<p>ستعرفين إن كان طيب القلب أو لئيماً و سيتبين لك إن تشاجرتما في المستقبل كيف سيتعامل معك.. هذه معظم الأسئلة التي فكرت فيها و أراها مهمة جداً لكل مقبلة على الزواج, و يمكنك أن تجعلي أمك أو أباك يطرحون بعض الأسئلة إن كنت تشعرين باحراج, و لكن لا تفوتي فرصة فهم هذا الرجل قبل أن توافقي عليه و يصبح زوجك.. و بامكانك بعد المقابلة أن تجلسي مع نفسك و تكتبي كل الصفات التي استخلصتيها منه و تقسمي الورقة بالنصف, اليمين للصفات الحسنة و اليسار للسيئة, ثم انظري ان كانت صفاته الحسنة تطغى و ان كنت تستطيعين العيش مع صفاته السيئة.. لأنه في النهاية لا يوجد انسان من دون سيئات فالكمال لله وحده و أنت وحدك من تقررين إن كنت تستطعين تحمل سيئاته.. و طبعاً لا تنس صلاة الاستخارة و استشارة الوالدين.. كم كنت أتمنى لو كنت أفكر بهذه الطريقة قبل زواجي, لذلك أتمنى منكن أن تتخذن هذا الموضوع على محمل الجد و توازن الأمور بالمنطق قبل اتخاذ أي قرار..</p>', '', 1, 22, '2019-02-04 20:48:40', 421, '', '2019-02-04 20:57:25', 421, 0, '0000-00-00 00:00:00', '2019-02-04 20:48:40', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"