(11, 5, 1, '', '2018-09-22 11:09:15', 421, 3264, 'bb8365e7b71843497b5bddc8aec5243880b91670', '{\"id\":5,\"asset_id\":\"40\",\"title\":\"Vos modules\",\"alias\":\"vos-modules\",\"introtext\":\"<p>Votre site poss\\u00e8de quelques modules communs d\\u00e9j\\u00e0 pr\\u00e9-configur\\u00e9s. Cela inclut :<\\/p>\\r\\n<ul>\\r\\n<li>Le \\u00ab\\u00a0Module image\\u00a0\\u00bb qui affiche l\'image sous le menu. C\'est un module de type \\u00ab\\u00a0Contenu personnalis\\u00e9\\u00a0\\u00bb que vous pouvez modifier pour changer l\'image.<\\/li>\\r\\n<li>Le module \\u00ab\\u00a0Articles les plus lus\\u00a0\\u00bb liste les articles, bas\\u00e9 sur le nombre de fois o\\u00f9 ils ont \\u00e9t\\u00e9 affich\\u00e9s.<\\/li>\\r\\n<li>Le module \\u00ab\\u00a0Articles les plus anciens\\u00a0\\u00bb liste les articles par mois.<\\/li>\\r\\n<li>Le module \\u00ab\\u00a0Lien de flux RSS\\u00a0\\u00bb permet \\u00e0 vos lecteurs de lire vos articles dans un lecteur de flux (Fil d\'actualit\\u00e9).<\\/li>\\r\\n<\\/ul>\\r\\n<p>Chacun de ces modules poss\\u00e8de de nombreux param\\u00e8tres que vous pouvez exp\\u00e9rimenter dans la \\u00ab\\u00a0Gestion des modules\\u00a0\\u00bb \\u00e0 partir de l\'administration. Joomla inclut \\u00e9galement de nombreux autres modules que vous pouvez incorporer \\u00e0 votre site. En d\\u00e9veloppant votre site, vous souhaiterez sans doute ajouter d\'autres modules, vous pourrez en trouver sur le site officiel des extensions de Joomla (<a href=\\\"https:\\/\\/extensions.joomla.org\\\">JED - Joomla Extensions Directory)<\\/a> ou sur le site officiel des extensions en fran\\u00e7ais pour Joomla (<a href=\\\"http:\\/\\/extensions.joomla.fr\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">extensions.joomla.fr<\\/a>).<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"11\",\"created\":\"2018-06-23 19:58:35\",\"created_by\":\"421\",\"created_by_alias\":\"Joomla\",\"modified\":\"2018-09-22 11:09:15\",\"modified_by\":\"421\",\"checked_out\":\"421\",