(26, 2, 1, '', '2018-09-23 11:49:16', 421, 4688, '857f89ed164d27e2fafcec4e0fd95da0e0ad3e37', '{\"id\":2,\"asset_id\":\"37\",\"title\":\"VERITATIS ET QSRCH BEATAE VITAE\",\"alias\":\"news-1\",\"introtext\":\"<p>Vous trouverez ici quelques astuces basiques pour travailler sur votre site.<\\/p>\\r\\n<ul>\\r\\n<li>Joomla! a une partie \\u00abSite\\u00bb (ou frontale), que vous \\u00eates en train de regarder, et une partie \\u00abAdministration\\u00bb (ou arri\\u00e8re) qui est l\'endroit o\\u00f9 vous effectuez le travail plus avanc\\u00e9 comme r\\u00e9gler les menus ou d\\u00e9cider quels modules afficher. Vous devez vous connecter \\u00e0 l\'administration s\\u00e9par\\u00e9ment en utilisant le m\\u00eame identifiant et le m\\u00eame mot de passe que vous utilisez sur cette partie du site.<\\/li>\\r\\n<li>Une des premi\\u00e8res choses que vous souhaiterez faire sera probablement de changer le titre du site ansi que sa description. Pour cela, connectez-vous \\u00e0 l\'administration puis, dans le menu \\u00abExtensions\\u00bb, cliquez sur \\u00abGestion des templates\\u00bb. Ce site est install\\u00e9 avec le template \\u00abProtostar\\u00bb (actuellement utilis\\u00e9) et le template \\u00abBeez3\\u00bb. Pour appliquer un template, cliquez sur l\'\\u00e9toile \\u00e0 droite de son titre, la couleur jaune indique que le template est celui utilis\\u00e9. En cliquant sur le nom du template, un formulaire est affich\\u00e9 vous permettant de modifier les param\\u00e8tres selon vos souhaits. Vous pouvez exp\\u00e9rimenter les diff\\u00e9rents param\\u00e8tres propos\\u00e9s.<\\/li>\\r\\n<li>Vous souhaitez probablement installer un nouveau template pour changer l\'aspect du site. Pour cela, dans le menu \\u00abExtension\\u00bb, cliquez sur \\u00abGestion des extensions\\u00bb, vous acc\\u00e9dez \\u00e0 l\'onglet \\u00abInstallation\\u00bb.<br \\/>Il existe de nombreux templates gratuits et commerciaux pour Joomla!<\\/li>\\r\\n<li>Comme vous l\'avez d\\u00e9j\\u00e0 vu, vous pouvez contr\\u00f4ler qui peut voir les diff\\u00e9rentes parties de votre site. Quand vous travaillez aves des modules, articles ou liens web, r\\u00e9gler le niveau d\'acc\\u00e8s sur \\u00abEnregistr\\u00e9\\u00bb signifie que seuls les utilisateurs identifi\\u00e9s sur le site pourront y acc\\u00e9der.<\\/li>\\r\\n<li>Quand vous cr\\u00e9ez un nouvel article ou un autre type de contenu, vous pouvez \\u00e9galement l\'enregistrer comme \\u00abPubli\\u00e9\\u00bb ou \\u00abNon-publi\\u00e9\\u00bb. S\'il est \\u00abNon-publi\\u00e9\\u00bb, les visiteurs du site ne pourront pas le voir, mais vous oui.<\\/li>\\r\\n<li>Vous pouvez en apprendre d\'avantage sur comment travailler avec Joomla! en consultant le <a href=\\\"http:\\/\\/docs.joomla.org\\\">site de documentation Joomla<\\/a> et obtenir de l\'aide des autres utilisateurs en consultant les <a href=\\\"http:\\/\\/forum.joomla.org\\\">forums Joomla.org<\\/a> (en anglais) et les <a href=\\\"http:\\/\\/forum.joomla.fr\\\">forums Joomla.fr<\\/a> (en fran\\u00e7ais).<br \\/>Dans l\'administration, un bouton \\u00abAide\\u00bb est disponible dans toutes les interfaces, vous apportant des informations d\\u00e9taill\\u00e9es sur leur utilisation.<\\/li>\\r\\n<\\/ul>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"10\",\"created\":\"2018-06-23 19:58:35\",\"created_by\":\"421\",\"created_by_alias\":\"Joomla\",\"modified\":\"2018-09-23 11:49:16\",\"modified_by\":\"421\",\"checked_out\":\"421\",\"checked_out_time\":\"2018-09-23 11:47:27\",\"publish_up\":\"2018-06-23 19:58:35\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",