vu, vous pouvez contr\\u00f4ler qui peut voir les diff\\u00e9rentes parties de votre site. Quand vous travaillez aves des modules, articles ou liens web, r\\u00e9gler le niveau d\'acc\\u00e8s sur \\u00abEnregistr\\u00e9\\u00bb signifie que seuls les utilisateurs identifi\\u00e9s sur le site pourront y acc\\u00e9der.<\\/li>\\r\\n<li>Quand vous cr\\u00e9ez un nouvel article ou un autre type de contenu, vous pouvez \\u00e9galement l\'enregistrer comme \\u00abPubli\\u00e9\\u00bb ou \\u00abNon-publi\\u00e9\\u00bb. S\'il est \\u00abNon-publi\\u00e9\\u00bb, les visiteurs du site ne pourront pas le voir, mais vous oui.<\\/li>\\r\\n<li>Vous pouvez en apprendre d\'avantage sur comment travailler avec Joomla! en consultant le <a href=\\\"http:\\/\\/docs.joomla.org\\\">site de documentation Joomla<\\/a> et obtenir de l\'aide des autres utilisateurs en consultant les <a href=\\\"http:\\/\\/forum.joomla.org\\\">forums Joomla.org<\\/a> (en anglais) et les <a href=\\\"http:\\/\\/forum.joomla.fr\\\">forums Joomla.fr<\\/a> (en fran\\u00e7ais).<br \\/>Dans l\'administration, un bouton \\u00abAide\\u00bb est disponible dans toutes les interfaces, vous apportant des informations d\\u00e9taill\\u00e9es sur leur utilisation.<\\/li>\\r\\n<\\/ul>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"10\",\"created\":\"2018-06-23 19:58:35\",\"created_by\":\"421\",\"created_by_alias\":\"Joomla\",\"modified\":\"2018-09-23 12:12:14\",\"modified_by\":\"421\",\"checked_out\":\"421\",\"checked_out_time\":\"2018-09-23 12:10:58\",\"publish_up\":\"2018-06-23 19:58:35\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/news\\\\\\/latest-news-2.jpg\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",